import React from "react";
import { Button, Col, FormCheck, Stack } from "react-bootstrap";

const Todo = ({ text }) => {
  return (
    <div>
      <Stack direction="horizontal">

          <h3>{text}</h3>


          <FormCheck />
          <Button variant="danger">Delete</Button>

      </Stack>
    </div>
  );
};

export default Todo;
